data: pointArray
});
heatmap.setMap(map);
heatmap.set('maxIntensity', 0.200000);
heatmap.set('dissipating', true);
setGradient();
setLegendGradient();
setLegendLabels();
}
function toggleHeatmap() {heatmap.setMap(heatmap.getMap() ? null : map);}
function changeRadius() {heatmap.set('radius', heatmap.get('radius') ? null : 20);}
function changeOpacity() {heatmap.set('opacity', heatmap.get('opacity') ? null : 0.2);}
function setGradient() {
gradient = ["rgba(102, 255, 0, 0)",
"rgba(102, 255, 0, 1)",
"rgba(147, 255, 0, 1)",
"rgba(193, 255, 0, 1)",
"rgba(238, 255, 0, 1)",
"rgba(244, 227, 0, 1)",
"rgba(249, 198, 0, 1)",
"rgba(255, 170, 0, 1)",
"rgba(255, 113, 0, 1)",
"rgba(255, 57, 0, 1)",
"rgba(255, 0, 0, 1)"]
heatmap.set('gradient', gradient);
}
function setLegendGradient() {
var gradientCss = '(left';
for (var i = 0; i < gradient.length; ++i) {
gradientCss += ', ' + gradient[i];
}
gradientCss += ')';

$('#legendGradient').css('background', '-webkit-linear-gradient' + gradientCss);
$('#legendGradient').css('background', '-moz-linear-gradient' + gradientCss);
$('#legendGradient').css('background', '-o-linear-gradient' + gradientCss);
$('#legendGradient').css('background', 'linear-gradient' + gradientCss);
}
function setLegendLabels() {
google.maps.event.addListenerOnce(map, 'tilesloaded', function() {
var maxIntensity = 0.200000*25;
var legendWidth = $('#legendGradient').outerWidth();

for (var i = 0; i <= maxIntensity; ++i) {
var offset = i * legendWidth / maxIntensity;
if (i > 0 && i < maxIntensity) {
offset -= 0.5;
} else if (i == maxIntensity) {
offset -= 1;
}
$('#legend').append($('<div>').css({
'position': 'absolute',
'left': offset + 'px',
'top': '15px',
'width': '1px',
'height': '3px',
'background': 'black'
}));
$('#legend').append($('<div>').css({
'position': 'absolute',
'left': (offset - 5) + 'px',
'top': '18px',
'width': '10px',
'text-align': 'center',
'font-size': '0.8em',
}).html(i/25));
}
});
}
google.maps.event.addDomListener(window, 'load', initialize);
